/* p5.Math.js */
Math.sq=function(a){return a*a;};Math.constrain=function(a,l,h){return(a<l)?l:((a>h)?h:a);};Math.degrees=function(r){return r*(180/Math.PI);};Math.radians=function(d){return d*(Math.PI/180);};Math.mag=function(a,b){return Math.sqrt(a*a+b*b);};Math.dist=function(x1,y1,x2,y2){return Math.sqrt(Math.sq(x2-x1)+Math.sq(y2-y1));};Math.lerp=function(a,z,amt){return a+(z-a)*amt;};Math.norm=function(v,a,z){return (v-a)/(z-a);};Math.map=function (v,ia,iz,oa,oz){return oa+(oz-oa)*((v-ia)/(iz-ia));};